import "./form-input.scss";

const FormInput = ({ label, name, ...otherProps }) => {
	return (
		<div className="mb-3">
			<label htmlFor={name} className="form-label">
				{label}
			</label>
			<input className="form-control" required {...otherProps} />
		</div>
	);
};

export default FormInput;

